import Vue from 'vue';
import Chart from 'chart.js';
export default class ChartTest extends Vue{
    Oxygen:any;
    Chloro:any;
    Salinity:any;
    Water_temp:any;
    Turbidity:any;
    Oxygen_week:any;

    show = true;
    toggle(){
        this.show = false;
        console.log(this.show);
    }

    scrollElement(name:string){
        const target = <HTMLButtonElement>document.getElementById(name);
        target.scrollIntoView({behavior: "smooth", block: "center"});
    }

    plot_day_data(extract_data:{[key:number]:Array<any>}){
        let ctx1=<HTMLCanvasElement>document.getElementById("oxygen");
        let data_length=extract_data[1].length;
        this.Oxygen = new Chart(ctx1,{
            type:'line',
            data:{
                labels:[...Array(data_length)].map((_,index)=>index),
                datasets:[
                    {
                        //3,6,9,11
                        label:"3[m]",
                        data:[...Array<number>(data_length)].map((_,index)=>{
                            // extract_dataは配列でなく、整数キー（水深）の連想配列
                            return Number(extract_data[3][index].oxygen);
                        }),
                        borderColor: "rgba(255,0,0,1)",
                        backgroundColor: "rgba(0,0,0,0)"
                    },
                    {
                        label:"6[m]",
                        data:[...Array<number>(data_length)].map((_,index)=>{
                            // extract_dataは配列でなく、整数キー（水深）の連想配列
                            return Number(extract_data[6][index].oxygen);
                        }),
                        borderColor: "rgba(0,0,255,1)",
                        backgroundColor: "rgba(0,0,0,0)"
                    },
                    {
                        label:"9[m]",
                        data:[...Array<number>(data_length)].map((_,index)=>{
                            // extract_dataは配列でなく、整数キー（水深）の連想配列
                            return Number(extract_data[9][index].oxygen);
                        }),
                        borderColor: "rgba(0,255,0,1)",
                        backgroundColor: "rgba(0,0,0,0)"
