                        backgroundColor: "rgba(0,0,0,0)"
                    }
                ]
            },
            options:{
                title:{
                    display:true,
                    text:"溶存酸素[%]1日のグラフ",
                    fontSize: 18,
                },
            scales: {
                xAxes: [{
                    ticks: {
                        callback: function(value, index, values){
                            return value + "時";
                        },
                    },
                }],
                yAxes: [{
                    ticks: {
                        callback: function(value, index, values){
                            return  value;
                            }
                        }
                    }]
                }
            }
       })
