                    {
                        label:"3[m]",
                        data:[...Array<number>(data_length)].map((_,index)=>{
                            // extract_dataは配列でなく、整数キー（水深）の連想配列
                            return Number(extract_data[3][index].chlorophyll);
                        }),
                        borderColor: "rgba(255,0,0,1)",
                        backgroundColor: "rgba(0,0,0,0)"
                    },
                    {
                        label:"6[m]",
                        data:[...Array<number>(data_length)].map((_,index)=>{
                            // extract_dataは配列でなく、整数キー（水深）の連想配列
                            return Number(extract_data[6][index].chlorophyll);
                        }),
                        borderColor: "rgba(0,0,255,1)",
                        backgroundColor: "rgba(0,0,0,0)"
                    },
                    {
                        label:"9[m]",
                        data:[...Array<number>(data_length)].map((_,index)=>{
                            // extract_dataは配列でなく、整数キー（水深）の連想配列
                            return Number(extract_data[9][index].chlorophyll);
                        }),
                        borderColor: "rgba(0,255,0,1)",
                        backgroundColor: "rgba(0,0,0,0)"
                    },
                    {
                        label:"11[m]",
                        data:[...Array<number>(data_length)].map((_,index)=>{
                            // extract_dataは配列でなく、整数キー（水深）の連想配列
                            return Number(extract_data[11][index].chlorophyll);
                        }),
                        borderColor: "rgba(100,100,100,1)",
                        backgroundColor: "rgba(0,0,0,0)"
                    }
                ]
            },
            options:{
                title:{
                    display:true,
                    text:"クロロフィル[ppb]1日のグラフ",
                    fontSize: 18,
                },
            scales: {
                xAxes: [{
                    ticks: {
                        callback: function(value, index, values){
                            return value + "時";
                        },
                    },
                }],
                yAxes: [{
                    ticks: {
                        // suggestedMax: 2,
                        // suggestedMin: 0,
                        // stepSize: 2,
                        callback: function(value, index, values){
                            return value;
                            // return  value +  'm';
                            }
                        }
                    }]
                }
            }
        })
        let ctx3=<HTMLCanvasElement>document.getElementById("salinity");
        this.Salinity = new Chart(ctx3, {
            type:'line',
            data:{
                labels:[...Array(data_length)].map((_,index)=>index),
                datasets:[
                    {
                        label:"3[m]",
                        data:[...Array<number>(data_length)].map((_,index)=>{
                            // extract_dataは配列でなく、整数キー（水深）の連想配列
                            return Number(extract_data[3][index].salinity);
                        }),
                        borderColor: "rgba(255,0,0,1)",
                        backgroundColor: "rgba(0,0,0,0)"
                    },
                    {
                        label:"6[m]",
                        data:[...Array<number>(data_length)].map((_,index)=>{
                            // extract_dataは配列でなく、整数キー（水深）の連想配列
                            return Number(extract_data[6][index].salinity);
                        }),
                        borderColor: "rgba(0,0,155,1)",
                        backgroundColor: "rgba(0,0,0,0)"
                    },
                    {
                        label:"9[m]",
                        data:[...Array<number>(data_length)].map((_,index)=>{
                            // extract_dataは配列でなく、整数キー（水深）の連想配列
                            return Number(extract_data[9][index].salinity);
                        }),
                        borderColor: "rgba(0,255,0,1)",
                        backgroundColor: "rgba(0,0,0,0)"
                    },
                    {
                        label:"11[m]",
                        data:[...Array<number>(data_length)].map((_,index)=>{
                            // extract_dataは配列でなく、整数キー（水深）の連想配列
                            return Number(extract_data[11][index].salinity);
                        }),
                        borderColor: "rgba(100,100,100,1)",
                        backgroundColor: "rgba(0,0,0,0)"
                    }
                ]
            },
            options:{
                title:{
                    display:true,
                    text:"塩分濃度[mS/cm]1日のグラフ",
                    fontSize: 18,
                },
            scales: {
                xAxes: [{
                    ticks: {
                        callback: function(value, index, values){
                            return value + "時";
                        },
                    },
                }],
                yAxes: [{
                    ticks: {
                        // suggestedMax: 40,
                        // suggestedMin: 25,
                        // stepSize: 5,
                        callback: function(value, index, values){
                            return value;
                            // return  value +  'm';
                            }
                        }
                    }]
                }
            }
        })
        let ctx4=<HTMLCanvasElement>document.getElementById("water_temp");
        this.Water_temp = new Chart(ctx4, {
            type:'line',
            data:{
                labels:[...Array(data_length)].map((_,index)=>index),
                datasets:[
                    {
                        label:"3[m]",
                        data:[...Array<number>(data_length)].map((_,index)=>{
                            // extract_dataは配列でなく、整数キー（水深）の連想配列
                            return Number(extract_data[3][index].water_temp);
                        }),
                        borderColor: "rgba(255,0,0,1)",
                        backgroundColor: "rgba(0,0,0,0)"
                    },
                    {
                        label:"6[m]",
                        data:[...Array<number>(data_length)].map((_,index)=>{
                            // extract_dataは配列でなく、整数キー（水深）の連想配列
                            return Number(extract_data[6][index].water_temp);
                        }),
                        borderColor: "rgba(0,0,255,1)",
                        backgroundColor: "rgba(0,0,0,0)"
                    },
                    {
                        label:"9[m]",
                        data:[...Array<number>(data_length)].map((_,index)=>{
                            // extract_dataは配列でなく、整数キー（水深）の連想配列
                            return Number(extract_data[9][index].water_temp);
                        }),
                        borderColor: "rgba(0,255,0,1)",
                        backgroundColor: "rgba(0,0,0,0)"
                    },
                    {
                        label:"11[m]",
                        data:[...Array<number>(data_length)].map((_,index)=>{
                            // extract_dataは配列でなく、整数キー（水深）の連想配列
                            return Number(extract_data[11][index].water_temp);
                        }),
                        borderColor: "rgba(100,100,100,1)",
                        backgroundColor: "rgba(0,0,0,0)"
                    }
                ]
            },
            options:{
                title:{
                    display:true,
                    text:"水温[℃]1日のグラフ",
                    fontSize: 18,
                },
            scales: {
                xAxes: [{
                    ticks: {
                        callback: function(value, index, values){
                            return value + "時";
                        },
                    },
                }],
                yAxes: [{
                    ticks: {
                        // suggestedMax: 40,
                        // suggestedMin: -10,
                        // stepSize: 5,
                        callback: function(value, index, values){
                            return value;
                            // return  value +  'm';
                            }
                        }
                    }]
                }
            }
        })
        let ctx5=<HTMLCanvasElement>document.getElementById("turbidity");
        this.Turbidity = new Chart(ctx5, {
            type:'line',
            data:{
                labels:[...Array(data_length)].map((_,index)=>index),
                datasets:[
                    {
                        label:"3[m]",
                        data:[...Array<number>(data_length)].map((_,index)=>{
                            // extract_dataは配列でなく、整数キー（水深）の連想配列
                            return Number(extract_data[3][index].turbidity);
                        }),
                        borderColor: "rgba(255,0,0,1)",
                        backgroundColor: "rgba(0,0,0,0)"
                    },
                    {
                        label:"6[m]",
                        data:[...Array<number>(data_length)].map((_,index)=>{
                            // extract_dataは配列でなく、整数キー（水深）の連想配列
                            return Number(extract_data[6][index].turbidity);
                        }),
                        borderColor: "rgba(0,0,255,1)",
                        backgroundColor: "rgba(0,0,0,0)"
                    },
                    {
                        label:"9[m]",
                        data:[...Array<number>(data_length)].map((_,index)=>{
                            // extract_dataは配列でなく、整数キー（水深）の連想配列
                            return Number(extract_data[9][index].turbidity);
                        }),
                        borderColor: "rgba(0,255,0,1)",
                        backgroundColor: "rgba(0,0,0,0)"
                    },
                    {
                        label:"11[m]",
                        data:[...Array<number>(data_length)].map((_,index)=>{
                            // extract_dataは配列でなく、整数キー（水深）の連想配列
                            return Number(extract_data[11][index].turbidity);
                        }),
                        borderColor: "rgba(100,100,100,1)",
                        backgroundColor: "rgba(0,0,0,0)"
                    }
                ]
            },
            options:{
                title:{
                    display:true,
                    text:"濁度[FTU]1日のグラフ",
                    fontSize: 18,
                },
            scales: {
                xAxes: [{
                    ticks: {
                        callback: function(value, index, values){
                            return value + "時";
                        },
                    },
                }],
                yAxes: [{
                    ticks: {
                        // suggestedMax: 40,
                        // suggestedMin: -10,
                        // stepSize: 5,
                        callback: function(value, index, values){
                            return value;
                            // return  value +  'm';
                            }
                        }
                    }]
                }
            }
        })
    }
    plot_week_data(extract_data:{[key:number]:Array<any>}){
        let ctx1=<HTMLCanvasElement>document.getElementById("oxygen_week");
        let data_length=extract_data[1].length;
        this.Oxygen_week = new Chart(ctx1, {
            type:'line',
            data:{
                labels:[...Array(data_length)].map((_,index)=>data_length - 1 - index),
                datasets:[
                    {
                        label:"3[m]",
                        data:[...Array<number>(data_length)].map((_,index)=>{
                            // extract_dataは配列でなく、整数キー（水深）の連想配列
                            return Number(extract_data[3][index].oxygen);
                        }),
                        borderColor: "rgba(255,0,0,1)",
                        backgroundColor: "rgba(0,0,0,0)"
                    },
                    {
                        label:"6[m]",
                        data:[...Array<number>(data_length)].map((_,index)=>{
                            // extract_dataは配列でなく、整数キー（水深）の連想配列
                            return Number(extract_data[6][index].oxygen);
                        }),
                        borderColor: "rgba(0,0,255,1)",
                        backgroundColor: "rgba(0,0,0,0)"
                    },
                    {
                        label:"9[m]",
                        data:[...Array<number>(data_length)].map((_,index)=>{
                            // extract_dataは配列でなく、整数キー（水深）の連想配列
                            return Number(extract_data[9][index].oxygen);
                        }),
                        borderColor: "rgba(0,255,0,1)",
                        backgroundColor: "rgba(0,0,0,0)"
                    },
                    {
                        label:"11[m]",
                        data:[...Array<number>(data_length)].map((_,index)=>{
                            // extract_dataは配列でなく、整数キー（水深）の連想配列
                            return Number(extract_data[11][index].oxygen);
                        }),
                        borderColor: "rgba(100,100,100,1)",
                        backgroundColor: "rgba(0,0,0,0)"
                    }
                ]
            },
            options:{
                title:{
                    display:true,
                    text:"溶存酸素1週間分(12時)",
                    fontSize: 18,
                },
            scales: {
                xAxes: [{
                    ticks: {
                        callback: function(value, index, values){
                            return value + "日前";
                        },
                    },
                }],
                yAxes: [{
                    ticks: {
                        // suggestedMax: 40,
                        // suggestedMin: -10,
                        // stepSize: 5,
                        callback: function(value, index, values){
